Verenigde Staten
Actie / Thriller
105 minuten

een goeie film

met Nicolas Cage, Guy Pearce en January Jones

Wanneer de vrouw van Nick Gerard (Nicolas Cage) slachtoffer is geworden van een ernstige misdaad, besluit hij aan te kloppen 
bij een organisatie in de onderwereld. Met behulp van hun diensten wil hij wraak nemen op de daders.
